import org.apache.nifi.processor.io.StreamCallback
import java.nio.charset.StandardCharsets
import groovy.json.JsonOutput

flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def text = inputStream.getText('UTF-8').trim()
    def result = [:]

    try {
        // Try to parse as JSON first
        result = new groovy.json.JsonSlurper().parseText(text)
    } catch (ignored) {
        // Not JSON – try key-value parsing
        def parts = text.split(/[;|,]/)
        parts.each { pair ->
            def kv = pair.split(/[:=]/, 2)
            if (kv.size() == 2) {
                result[kv[0].trim()] = kv[1].trim()
            } else if (kv.size() == 1) {
                result["eventType"] = kv[0].trim()
            }
        }
    }

    // If still empty, fallback to raw message
    if (result.isEmpty()) {
        result["rawMessage"] = text
    }

    outputStream.write(JsonOutput.toJson(result).getBytes(StandardCharsets.UTF_8))
} as StreamCallback)

flowFile = session.putAttribute(flowFile, "mime.type", "application/json")
session.transfer(flowFile, REL_SUCCESS)

import org.apache.nifi.processor.io.StreamCallback
import java.nio.charset.StandardCharsets
import groovy.json.JsonSlurper
import groovy.json.JsonBuilder

def flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def text = inputStream.getText(StandardCharsets.UTF_8.name())

    // 🛠 Fix: Wrap separate JSON arrays into a single array
    def mergedJson = text.replaceAll("]\\s*\\[", ",")
    def json = new JsonSlurper().parseText(mergedJson)

    def billTo = json.find { it.siteUse == 'BILL_TO' }?.siteNumber
    def serviceLoc = json.find { it.siteUse == 'SERVICE LOCATION' }?.siteNumber

    def result = [
        billingSiteNumber : billTo,
        serviceSiteNumber : serviceLoc,
        nextivaCorpAccount: flowFile.getAttribute("corporateAccount"),
        oracleCorpAccount : flowFile.getAttribute("corporateAccountId")
    ]

    def outputJson = new JsonBuilder(result).toPrettyString()
    outputStream.write(outputJson.getBytes(StandardCharsets.UTF_8))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)
